package services;import model.entity.TipContinutEntity;import model.repository.TipContinutRepository;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import org.springframework.transaction.annotation.Transactional;import java.util.List;@Servicepublic class TipContinutServiceImpl implements TipContinutService {    @Autowired    private TipContinutRepository tipContinutRepository;    @Override    @Transactional    public List<TipContinutEntity> findAll() {        return (List<TipContinutEntity>) tipContinutRepository.findAll();    }    @Override    @Transactional    public TipContinutEntity save(TipContinutEntity entity) {        return tipContinutRepository.save(entity);    }}